import { Route, Routes } from 'react-router-dom';
import Home from './containers/Home';
import Items from './containers/Items';

const Router = () => {
    return (
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path= "/Items" element={<Items/>} />
        </Routes>
    );
};
export default Router;
